webpackJsonp([0x7187c31e5e6c],{5143:function(t,e){t.exports={data:{post:{html:"<p>We made it to Arizona at midnight Thursday morning. The temperature at that time (over 90F) was warmer than the entire summer in Hamburg.</p>\n<p>Christopher travelled much better than either of us, as I expected. We had normal tourist-class seats with Christopher on my lap. He slept, I couldn't move.</p>\n<p>After spending yesterday in jet-lag limbo, we're going to try to enjoy the sun today. We had Mexican food last night, tomorrow night we'll go to our first major league baseball game in over 6 years. It's little things like that that I miss. But not often.</p>",fields:{title:"Greetings from Arizona",date:"29 Sep 2000",url:"https://papascott.de/2000-09-29-greetings-from-arizona/"}}},pathContext:{slug:"/2000-09-29-greetings-from-arizona/",prev:{fields:{title:"Pack Day",date:"26 Sep 2000",slug:"/2000-09-26-pack-day/"}},next:{fields:{title:"Ballyard",date:"01 Oct 2000",slug:"/2000-10-01-ballyard/"}}}}}});
